import React, {isValidElement, useEffect, useState} from "react";
import { Link } from "react-router-dom";
import { useParams } from 'react-router-dom';

function EventDetail() {
    const {id} = useParams();

    useEffect(() => {
        fetchEventId();
    }, []);

    const [item, setItems] = useState([]);

    const fetchEventId = async () => {
        const data = await fetch(`/events/${id}`);
        const item = await data.json();
        console.log(item);
        setItems(item);
    }

    return (
<section class="text-gray-600 body-font">
  <div class="container px-5 py-24 mx-auto">
    <div class="text-center mb-20">
      <h1 class="sm:text-3xl text-2xl font-medium title-font text-gray-900 mb-4">Raw Denim Heirloom Man Braid</h1>
      <p class="text-base leading-relaxed xl:w-2/4 lg:w-3/4 mx-auto text-gray-500s">Blue bottle crucifix vinyl post-ironic four dollar toast vegan taxidermy. Gastropub indxgo juice poutine, ramps microdosing banh mi pug.</p>
      <div class="flex mt-6 justify-center">
        <div class="w-16 h-1 rounded-full bg-red-500 inline-flex"></div>
      </div>
    </div>

    <button class="flex mx-auto mt-16 text-white bg-red-500 border-0 py-2 px-8 focus:outline-none hover:bg-red-600 rounded text-lg">Button</button>
  </div>
</section>     
);
}

export default EventDetail;
